The '''Unknown''' refers to the blank areas on the borders of [[Gielinor]] which are inaccessible and represent unexplored territory. Unknown space completely surrounds the [[World Map]] and essentially serves as the edge of the game world. An example of the unknown is the southern border of [[Sophanem]]. The unknown can also be seen around the borders of a [[Player-owned house]]. It is coloured black, both on the world map and in-game.
[[File:The unknown.png|left|thumb|550px|The unknown border south of Nardah shown in-game (left), and on the world map (right).]]
